	if($('#contact-form').length > 0) {
		$('#contact-form').parsley();

		$('#contact-form').each( function (item) {
			var formdata = {};
			formdata.btn = $(this).find('#submit-button');
			formdata.btnText = formdata.btn.text();
			formdata.btnClass = formdata.btn.attr('class');
			formdata.btnIcon = formdata.btn.find('.loading-icon').removeClass('loading-icon');
			formdata.btnIconClass = formdata.btnIcon.attr('class');
			formdata.alert = $('#contact-widget-bottom').find('.alert');
			formdata.url = $(this).attr('action');
			$(this).data('formdata', formdata);
		});

		$('#contact-form').submit( function (e) {
			e.preventDefault();
			if(!$(this).parsley('isValid')) return;

			var $theForm = $(this);
			var data = $(this).serialize();
			var formdata = $(this).data('formdata');
			var sendbtn = function () {
				formdata.btnIcon.removeClass().addClass('fa fa-spinner fa-spin');
				formdata.btn.prop('disabled', true).removeClass().addClass('btn btn-success').find('span').text(formdata.btn.attr('data-sendtext'));
			}
			var unsendbtn = function () {
				formdata.btnIcon.removeClass().addClass(formdata.btnIconClass);
				formdata.btn.prop('disabled', false).removeClass().addClass(formdata.btnClass).find('span').text(formdata.btnText);
			}
			var errorsendbtn = function () {
				formdata.btnIcon.removeClass().addClass('fa fa-exclamation-triangle');
				formdata.btn.prop('disabled', true).removeClass().addClass('btn btn-danger').find('span').text(formdata.btn.attr('data-senderror'));
			}

			var successMessage = function (message, titre) {
				var titre = titre === undefined ? '' : titre;
				formdata.alert.removeClass('alert-danger').addClass('alert-success').html(message).slideDown('medium');
				toastr['success'](message, titre, {positionClass: 'toast-top-center', onHidden: function () { formdata.alert.slideUp('medium'); unsendbtn(); }});
			}
			var errorMessage = function (message, titre) {
				var titre = titre === undefined ? '' : titre;
				errorsendbtn();
				formdata.alert.removeClass('alert-success').addClass('alert-danger').html(message).slideDown('medium');
				toastr['error'](message, titre, {positionClass: 'toast-top-center', onHidden: function () { formdata.alert.slideUp('medium'); unsendbtn(); }});
			}

			sendbtn();
			if(DEVMODE) console.log('URL', formdata.url);
			$.post(formdata.url, data, function (aeReponse) {
				if(DEVMODE) console.log(aeReponse);
				if(aeReponse.result == true) {
					$('textarea#contact-message').val('');
					successMessage(aeReponse.message);
				} else {
					errorMessage(aeReponse.message);
				}
			})
			.fail(function (error) {
				var message = " : ";
				if(DEVMODE) message += $(error.responseText).find('div#traces-text').text();
				errorMessage("Une erreur s'est produite lors de l'envoi du message"+message, "Erreur message");
				// if(DEVMODE) $('body').append($(error.responseText));
				if(DEVMODE) console.warn('AJAX Error', error);
			});
		});
	}
	

